/*Table structure for table `base_sequence` */

DROP TABLE IF EXISTS `base_sequence`;

CREATE TABLE `base_sequence` (
  `name_` varchar(50) NOT NULL COMMENT '序列号名称',
  `current_value_` bigint(20) NOT NULL COMMENT '当前值',
  `increment_` int(3) NOT NULL DEFAULT '1' COMMENT '增长步长',
  PRIMARY KEY (`name_`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='序列表';

/*Data for the table `base_sequence` */

insert  into `base_sequence`(`name_`,`current_value_`,`increment_`) values ('seq_demo',10009,1);

/*Table structure for table `base_user` */

DROP TABLE IF EXISTS `base_user`;

CREATE TABLE `base_user` (
  `id_` varchar(20) NOT NULL COMMENT '流水号',
  `account_` varchar(255) NOT NULL COMMENT '用户登录帐号',
  `password_` varchar(255) NOT NULL COMMENT '密码',
  `name_` varchar(255) DEFAULT '' COMMENT '昵称',
  `sex_` varchar(255) DEFAULT '' COMMENT '性别',
  `status_` varchar(255) NOT NULL DEFAULT '' COMMENT '用户状态（是否屏蔽）',
  `type_` varchar(255) DEFAULT '' COMMENT '用户类型用户类型，1：管理员,2：会员',
  `org_id_` varchar(400) DEFAULT '' COMMENT '图片地址',
  `email_` varchar(255) DEFAULT '' COMMENT '电子邮件',
  `mobile_` varchar(255) DEFAULT '' COMMENT '手机号',
  `idno_` varchar(255) DEFAULT '' COMMENT '身份证号',
  `skin_` varchar(255) DEFAULT 'blue' COMMENT '用户界面皮肤',
  `biz_code_` varchar(255) DEFAULT '' COMMENT '业务对照码',
  `address_` varchar(500) DEFAULT '' COMMENT '联系地址',
  `remark_` varchar(4000) DEFAULT '' COMMENT '介绍/备注',
  `is_del_` varchar(255) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  `create_time_` datetime NOT NULL COMMENT '创建时间',
  `create_by_` varchar(20) DEFAULT NULL COMMENT '创建人ID',
  `login_time_` datetime DEFAULT NULL COMMENT '最后登录时间',
  `sort_` int(11) DEFAULT NULL COMMENT '排序',
  `registration_id` varchar(255) DEFAULT NULL COMMENT '设备ID',
  `registration_type` varchar(255) DEFAULT NULL COMMENT '设备类型',
  `is_huanxin` varchar(5) DEFAULT '0' COMMENT '是否注册环信',
  `gold_coins` decimal(10,2) DEFAULT '0.00' COMMENT '金币',
  `pay_password` varchar(255) DEFAULT '' COMMENT '支付密码',
  `deposit_amt` decimal(10,2) DEFAULT '0.00' COMMENT '押金',
  `deposit_date` datetime DEFAULT NULL COMMENT '押金支付时间',
  `deposit_status` varchar(10) DEFAULT '0' COMMENT '押金状态，0:未交，1：已交，-1：已退,2：申请退款中',
  `grade_` varchar(255) DEFAULT '0' COMMENT '级别，silver：银牌会员，gold\n：金牌会员，platinum\n：白金会员',
  `user_name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `id_card` varchar(50) DEFAULT NULL COMMENT '身份证号码',
  `vehicle_license` varchar(50) DEFAULT NULL COMMENT '行驶证号',
  `driver_license` varchar(50) DEFAULT NULL COMMENT '驾驶证号',
  `vehicle_img` varchar(400) DEFAULT NULL COMMENT '行驶证图片',
  `driver_img` varchar(400) DEFAULT NULL COMMENT '驾驶证图片',
  `user_img` varchar(400) DEFAULT NULL COMMENT '用户头像',
  `is_cert` varchar(255) DEFAULT '0' COMMENT '是否认证，0：未认证，1：认证通过，-1：认证不通过,2：已填写认证信息',
  `gold_coins_status` varchar(10) DEFAULT '1' COMMENT '金币状态,1：正常，-1：已退,2：申请退款中',
  PRIMARY KEY (`id_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户基本信息表';

