/*Table structure for table `charging_orders` */

DROP TABLE IF EXISTS `charging_orders`;

CREATE TABLE `charging_orders` (
  `co_id` varchar(255) NOT NULL,
  `user_id` varchar(255) DEFAULT NULL COMMENT '用户ID',
  `cp_id` varchar(255) DEFAULT NULL COMMENT '充电桩ID',
  `amounted` decimal(10,2) DEFAULT NULL COMMENT '已充金额',
  `dateed` decimal(10,2) DEFAULT NULL COMMENT '已充时间',
  `electricity` decimal(10,2) DEFAULT NULL COMMENT '已充电量',
  `rest_date` decimal(10,2) DEFAULT NULL COMMENT '剩余时间',
  `total_amt` decimal(10,2) DEFAULT '0.00' COMMENT '总金额',
  `deduction_amt` decimal(10,2) DEFAULT NULL COMMENT '抵扣金额',
  `real_amt` decimal(10,2) DEFAULT NULL COMMENT '实付金额',
  `status_` varchar(255) DEFAULT '0' COMMENT '状态，0：充电中，1：充电结束，2：支付成功，-1：取消,-2:充电确定中，-3，不同意充电',
  `co_type` varchar(255) DEFAULT NULL COMMENT '计算类型，0：金额，1：时间，2：度数，3：充满',
  `co_num` decimal(10,2) DEFAULT NULL COMMENT '数量',
  `deduction_type` varchar(255) DEFAULT '-1' COMMENT '抵扣类型，0：折扣，1：优惠券',
  `is_del` varchar(255) DEFAULT '0' COMMENT '是否删除，0：未删除，1：删除',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `oper_id` varchar(255) DEFAULT NULL COMMENT '操作人ID',
  `degree` decimal(10,2) DEFAULT NULL COMMENT '电量度数（需换算）',
  `put_gun` varchar(255) DEFAULT '0' COMMENT '是否插枪',
  `puted_gun_date` datetime DEFAULT NULL COMMENT '拔枪时间',
  `put_gun_date` datetime DEFAULT NULL COMMENT '插枪时间',
  `complete_date` datetime DEFAULT NULL COMMENT '完成时间',
  `update_date` datetime DEFAULT NULL COMMENT '最后更新时间',
  `reason` varchar(200) DEFAULT NULL COMMENT '不同意原因',
  `discount` decimal(10,3) DEFAULT NULL COMMENT '折扣',
  PRIMARY KEY (`co_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充电订单表';

