/*Table structure for table `charging_pile` */

DROP TABLE IF EXISTS `charging_pile`;

CREATE TABLE `charging_pile` (
  `cp_id` varchar(255) NOT NULL COMMENT '主键',
  `cp_no` varchar(100) DEFAULT NULL COMMENT '编号',
  `supplier` varchar(100) DEFAULT NULL COMMENT '供应商',
  `province` varchar(100) DEFAULT NULL COMMENT '省',
  `city` varchar(100) DEFAULT NULL COMMENT '市',
  `county` varchar(100) DEFAULT NULL COMMENT '区',
  `addr` varchar(200) DEFAULT NULL COMMENT '地址',
  `cp_type` varchar(50) DEFAULT NULL COMMENT '型号',
  `electricity` decimal(10,2) DEFAULT NULL COMMENT '充电费',
  `cp_status` varchar(255) DEFAULT NULL COMMENT '状态,1:可用，2：占用，3：故障',
  `lon` double(10,5) DEFAULT NULL COMMENT '经度',
  `lat` double(10,5) DEFAULT NULL COMMENT '纬度',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `is_del` varchar(5) DEFAULT '0' COMMENT '是否删除，0：未删除，1：删除',
  `oper_id` varchar(50) DEFAULT NULL COMMENT '操作人ID',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `net_way` varchar(255) DEFAULT NULL COMMENT '网络方式',
  `signal_quality` varchar(255) DEFAULT NULL COMMENT '信号质量',
  `is_activation` varchar(50) DEFAULT NULL COMMENT '是否激活，0：未激活，1：已激活',
  `fault_code` varchar(255) DEFAULT NULL COMMENT '故障码',
  PRIMARY KEY (`cp_id`),
  KEY `index_lon` (`lon`),
  KEY `index_lat` (`lat`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充电桩';

