/*Table structure for table `common_comment` */

DROP TABLE IF EXISTS `common_comment`;

CREATE TABLE `common_comment` (
  `cc_id` varchar(255) NOT NULL DEFAULT '' COMMENT '主键',
  `user_id` varchar(255) DEFAULT '' COMMENT '用户ID',
  `comment_` varchar(500) DEFAULT '' COMMENT '投诉内容',
  `status_` varchar(6) DEFAULT '0' COMMENT '状态,0:新建，1：发布，2：不发布',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `publish_date` datetime DEFAULT NULL COMMENT '发布时间',
  `oper_id` varchar(50) DEFAULT '' COMMENT '发布人ID',
  `img_url1` varchar(400) DEFAULT '' COMMENT '图片地址1',
  `img_url2` varchar(400) DEFAULT NULL COMMENT '图片地址2',
  `img_url3` varchar(400) DEFAULT NULL COMMENT '图片地址3',
  `img_url4` varchar(400) DEFAULT NULL COMMENT '图片地址4',
  `img_url5` varchar(400) DEFAULT NULL COMMENT '图片地址5',
  `img_url6` varchar(400) DEFAULT NULL COMMENT '图片地址6',
  `is_del` varchar(5) DEFAULT '0' COMMENT '是否删除，0：未删除，1：删除',
  PRIMARY KEY (`cc_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='投诉建议';

