/*Table structure for table `deposit_list` */

DROP TABLE IF EXISTS `deposit_list`;

CREATE TABLE `deposit_list` (
  `deposit_id` varchar(255) NOT NULL COMMENT '主建',
  `user_id` varchar(255) DEFAULT NULL COMMENT '用户ID',
  `amt` decimal(10,2) DEFAULT NULL COMMENT '押金金额',
  `status` varchar(5) DEFAULT '0' COMMENT '0:提交申请，1：审核通过，-1：审核不通过，2：退款成功',
  `audit_date` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_id` varchar(255) DEFAULT NULL COMMENT '审核人',
  `pay_date` datetime DEFAULT NULL COMMENT '放款时间',
  `pay_id` varchar(255) DEFAULT NULL COMMENT '放款人',
  `remark` varchar(1000) DEFAULT NULL COMMENT '备注',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `is_del` varchar(255) DEFAULT '0' COMMENT '是否删除，0：未删除，1：已删除',
  `oper_id` varchar(255) DEFAULT '0' COMMENT '类型，0：押金，1：余额',
  `account` varchar(255) DEFAULT NULL COMMENT '帐号',
  `name` varchar(255) DEFAULT NULL COMMENT '姓名',
  PRIMARY KEY (`deposit_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='押金申请记录表';

