  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `is_del` varchar(255) DEFAULT '0' COMMENT '是否删除，0：未删除，1：删除',
  PRIMARY KEY (`s_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预约充电';

