/* Function  structure for function  `currval` */

/*!50003 DROP FUNCTION IF EXISTS `currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `currval`(seq_name_ VARCHAR(50)) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
BEGIN  
  
DECLARE out_current_value_ INTEGER;  
  
SET out_current_value_ = 0;  
  
SELECT current_value_ INTO out_current_value_ FROM aos_sequence WHERE name_ = seq_name_;  
  
RETURN out_current_value_;  
  
END */$$
DELIMITER ;

/* Function  structure for function  `nextval` */

/*!50003 DROP FUNCTION IF EXISTS `nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `nextval`(seq_name_ VARCHAR(50)) RETURNS bigint(20)
    DETERMINISTIC
BEGIN
  
UPDATE aos_sequence SET current_value_ = current_value_ + increment_ WHERE name_ = seq_name_;
RETURN currval(seq_name_);
  
END */$$
DELIMITER ;

